import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = (props) => {
  return <div>
      <h1> Welcome to Silencio Bruno </h1>
      <img className="mr-3" width="304"src={props.logo} alt=""/>
      <Link to = {`/`} > <button type="button" class="btn btn-outline-danger"> Salir </button> </Link>
  </div>;
};

export default NavBar;
